import React from 'react';
import "../assets/css/footer.scss";

export default class Footer extends React.Component {
    render() {
        return (
            <div className="footer">
                <div>Home icon made by <a href="https://www.flaticon.com/authors/bqlqn" title="bqlqn">bqlqn</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div><br/>
                <div>Icons made by <a href="https://www.flaticon.com/authors/freepik" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div><br/>
            </div>
       )
    }
}
